import React, { Component } from 'react';
import "./Products.css";

class Products extends Component{
    constructor(props){
        super(props);
        this.state = {}
    }
    render(){
        return(
            <div className='row products'>
                <div className='col-lg-3'></div>
                <div className='col-lg-2 col-xl-3 tiles'></div>
                <div className='col-lg-2 col-xl-3 tiles'></div>
                <div className='col-lg-2 col-xl-3 tiles'></div>
            </div>
        )
    }
}

export default Products;
